import React from 'react';
import User from './User';

// zasto tu moram eksplicitno napisat users i zasto moram destruktuirat
const Users = ({users}) => {
    return(
        <div style={{display: 'inline-block', width: '50%', height: 'auto', background: 'white', margin: '0px 25px'}}>
            {
                users.map( (element, i) => {
                    return <User 
                    name={users[i].name} 
                    username={users[i].username}
                    email={users[i].email}
                    /> 
                })
            }
        </div>
    );
}

export default Users;
